import bmwLogos from '../assets/bmw.webp';
import heroLogos from '../assets/hero.webp';
import ktmLogos from '../assets/ktm.webp';
import kawasakiLogos from '../assets/kawasaki.webp';
import yamahaLogos from '../assets/yamaha.webp';
import royalEnfieldLogos from '../assets/royal-enfield.webp';
import bajajLogos from '../assets/bajaj.webp';
import ducatiLogos from '../assets/ducati.webp';

import '../styles/Company.css';

const brands = [
  { id: 'bmw', name: 'BMW', logo: bmwLogos },
  { id: 'hero', name: 'Hero MotoCorp', logo: heroLogos },
  { id: 'ktm', name: 'KTM', logo: ktmLogos },
  { id: 'kawasaki', name: 'Kawasaki', logo: kawasakiLogos },
  { id: 'yamaha', name: 'Yamaha', logo: yamahaLogos },
  { id: 'royal-enfield', name: 'Royal Enfield', logo: royalEnfieldLogos },
  { id: 'bajaj', name: 'Bajaj', logo: bajajLogos },
  { id: 'ducati', name: 'Ducati', logo: ducatiLogos },
];

const overview = `
  The world’s leading motorcycle brands offer a remarkable diversity of machines tailored for every type of rider. From BMW’s precision-engineered premium bikes to Hero MotoCorp’s mass-market appeal,
  KTM’s aggressive off-road and street performance, Kawasaki and Yamaha’s innovative engineering, Royal Enfield’s timeless classics,
  Bajaj’s affordable and reliable commuters, and Ducati’s iconic Italian sportbikes — these brands together shape the global motorcycle landscape,
  providing enthusiasts with unparalleled options that range from daily practical rides to thrilling high-performance machines.
`;

const BrandPage = () => {
  return (
    <div className="brand-page-container">
      <h1>Explore Top Motorcycle Brands</h1>
      <p className="overview-text">{overview}</p>

      <div className="brands-grid">
        {brands.map(({ id, name, logo }) => (
          <div key={id} className="brand-box">
            <img src={logo} alt={`${name} Logo`} className="brand-logo" />
            <h3 className="brand-name">{name}</h3>
          </div>
        ))}
      </div>
    </div>
  );
};

export default BrandPage;
